import React from 'react';
import CabinetForm from "../components/CabinetForm/CabinetForm";
import Header from "../components/Header/Header";

const Cabinet = () => {
	return (
		<div className="content">
			<Header
				title={'Personal Cabinet'}
			/>
			<CabinetForm />
		</div>
	);
};

export default Cabinet;
